import React, { useState } from 'react'
import { Button, Form, FloatingLabel } from 'react-bootstrap'

const Edit = (props) => {

    const service = props.editservice
    const [availability, setAvailability] = useState(service.availability)
    const [loading, setLoading] = useState()

    function handleSave(e) {
        e.preventDefault()
        console.log(availability)
    }

    return (
        <>
            <Form className='p-3'>
                <Form.Group>
                    <FloatingLabel className='mb-3' label='Service Type' >
                        <Form.Control
                            placeholder='Service Type'
                            required
                            type='text'
                            value={service.name}
                            disabled={true}
                        />
                    </FloatingLabel>
                </Form.Group>
                <Form.Group>
                    <FloatingLabel className='mb-3' label='Availability' >
                        <Form.Control
                            placeholder='Availability'
                            required
                            value={availability}
                            type='text'
                            onChange={(e) => setAvailability(e.target.value)}
                        />
                    </FloatingLabel>
                </Form.Group>

                <div className='d-flex justify-content-center' style={{ gap: '5px' }}>
                    <Button
                        variant='danger'
                        type='submit'
                        style={{ minWidth: '150px' }}
                        onClick={handleSave}
                        disabled={loading}
                    >
                        Delete
                    </Button>

                    <Button
                        variant='success'
                        type='submit'
                        style={{ minWidth: '150px' }}
                        onClick={handleSave}
                        disabled={loading}
                    >
                        Save
                    </Button>
                </div>
            </Form>
        </>
    )
}

export default Edit
